6add4a0b-d083-4ac0-8968-c54a86feeb14=Using a theme is as easy as clicking download and import\!\r\n\r\nThis layout provides 16 great looking free themes from the bootswatch.com library of themes. These themes are fully compatible with Mendix 5 and have been packaged up to make it easy for you to use them in your own project.\r\n\r\nTo view all the themes available click on the themes option in menu bar at the top.\r\n\r\n
a473daf5-30ff-4de4-869d-cdb5d5a1cced=Preview and download
dcb1342d-0fcd-4a55-ad3f-0b0aa5ce469b=To download the zipped theme package simply click download on the theme you wish to download.\r\nIf you would like to preview what this theme looks like then simply press preview and it will bring up the selected theme for you with example components.\r\n\r\n\r\n
cd2cb165-2c31-41a7-a67d-0458e1cec17f=Installing a theme
3f25097a-2fd5-4ec9-9970-6ca0c2a9cd68=\r\nIf you would like to change the base theme of this project then simply click settings in the modeller and then click the tab model. You can then select from one of the themes that is contained in the theme folder. All themes that are featured in the themes section are included in the theme folder.\r\n\r\n
a17f8e88-5e10-48c8-8ba0-81cad5ef1515=To open up the theme folder simply press project from the modeller menu bar and press show project directory in explorer in the modeller. Then click on the theme folder and you will see all of the zipped themes available.\r\n\r\n
